import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./Components/Header";
import HomePage from "./Page/HomePage";
import AboutUs from "./Page/AboutUs";
import Footer from "./Components/Footer";
import Contact from "./Page/ContactUs";
import Blogs from "./Page/Blogs";
import BlogSingle from "./Components/BlogSingle";
import PopUp from "./Components/PopUp";
import Dashboard from "./Page/Dashboard";
import ContentChange from "./Page/ContentChange";

const App = () => {
  return (
    <>
      <Router>
        <Routes>
          <Route exact path="/" element={<HomePage />}></Route>
          <Route exact path="/about" element={<AboutUs />}></Route>
          <Route exact path="/contact" element={<Contact />}></Route>
          <Route exact path="/blogs" element={<Blogs />}></Route>
          <Route exact path="/blogsingle" element={<BlogSingle />}></Route>
          <Route exact path="/register" element={<PopUp />}></Route>
          <Route exact path="/dashboard" element={<Dashboard />}></Route>
          <Route
            exact
            path="/blogs/:id"
            element={<BlogSingle id="64d25f696d0b6edbdd662443" />}
          ></Route>
          <Route
            exact
            path="/dashboard/contentupdate"
            element={<ContentChange />}
          ></Route>
        </Routes>
      </Router>
    </>
  );
};
export default App;
